import React, { useState } from "react";

export default function CommentSection() {
  const initialComment = {
    name: "",
    email: "",
    comment: "",
  };
  const [comment, setComment] = useState(initialComment);


  // This will set the initialComment 
  const handleOnCommentChange = (e) => {
    setComment({...comment , [e.target.name]:e.target.value});
    console.log(comment)
  };
  


  // Work in Post Submit 
  const handleOnPostComment  = async(e)=>{
    e.preventDefault()
  }
  


  return (
    <>
      {/* Comments Section */}
      <div className="container-fluid border bg-light my-5 p-5">
        <div style={{ fontFamily: "Libre Baskerville" }} className="container">
          <h1>Comments</h1>
        </div>

        {/* ------------------------------------------------------Add Comment Form */}
        <div className="bg-light container">
          <div className="container">
            <h2 style={{ fontFamily: "Libre Baskerville" }}>Add Comment</h2>
          </div>

          {/* Add Comments */}
          <div className=" my-5">
            <form onSubmit={handleOnPostComment} >
              <div className="form-outline border-dark border-bottom p-2">
              <label className="form-label" >
                  Username
                </label>
                <input onChange={handleOnCommentChange} type="text" name="name" className="form-control" />

              </div>

              <div className="form-outline border-dark border-bottom p-2 my-5">
              <label className="form-label" >
                  Your Email
                </label>
                <input onChange={handleOnCommentChange} type="email" name="email" className="form-control" />

              </div>

              <div className="form-outline border-dark border-bottom p-2 my-5">
              <label className="form-label" >
                  Comment{" "}
                </label>
                <textarea
                onChange={handleOnCommentChange}
                  name="comment"
                  style={{ borderRadius: "0px", width: "100%" }}
                  className="form-control bord"
                  id="textAreaExample"
                  rows="5"
                ></textarea>

              </div>

              <button type="submit" className="btn btn-primary w-100 py-3">Submit</button>

              <form onSubmit={handleOnLogin}>
          {/* <!-- Email input --> */}
          <div className="d-flex flex-row align-items-center mb-4">
    <i className="fas fa-envelope fa-lg me-3 fa-fw"></i>
    <input onChange={handleOnLoginChange} type="text" id="form3Example1c" name='email' placeholder="Your Email" className="form-control " />
  </div>

          {/* <!-- Password input --> */}
          <div className="d-flex flex-row align-items-center mb-4">
    <i className="fas fa-lock fa-lg me-3 fa-fw"></i>
      <input onChange={handleOnLoginChange} type="password" id="form3Example4c" name='password' placeholder="Password" className="form-control " />
  </div>


  {/* Set error here */}
  {loginError ? <p style={{textAlign:"center" , color:"red"}}>{loginError}</p> : ''}

          {/* <!-- Submit button --> */}
          <button  type="submit" className="btn btn-primary btn-lg btn-block">Login in</button>
          

          <div className="divider d-flex align-items-center my-4">
            <p className="text-center fw-bold mx-3 mb-0 text-muted">OR</p>
          </div>

          <div className='my-3' style={{textAlign:"center" , width:"100%"}}>
          <button style={{width:"100%"}} onClick={handleShowLoginSignup} className='btn btn-primary'>Don't have account?</button>
          </div>
          <a className="btn btn-primary btn-lg btn-block" style={{backgroundColor: '#3b5998'}} href="#!"
            role="button">
            <i className="fab fa-facebook-f me-2"></i>Continue with Facebook
          </a>
          <a className="btn btn-primary btn-lg btn-block" style={{backgroundColor: '#55acee'}} href="#!"
            role="button">
            <i className="fab fa-twitter me-2"></i>Continue with Twitter</a>

        </form>
            </form>
          </div>
        </div>
      </div>
    </>
  );
}
